<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8" />
  <meta name="viewport"
    content="width=device-width,initial-scale=1.0,minimum-scale=1.0, maximum-scale=1.0,user-scalable=no" />
  <meta name="Keywords" content="react" />
  <link rel="stylesheet" href="https://static.boohee.cn/css/reset/1.0.0/reset.min.css" />
  <script>
    (function () {
      if (
        !/console=true/.test(window.location)
      )
        return;
      const src = "https://unpkg.com/vconsole/dist/vconsole.min.js";
      document.write("<scr" + 'ipt src="' + src + '"></scr' + "ipt>");
      document.write("<scr" + "ipt>new window.VConsole();</scr" + "ipt>");
    })();
  </script>
  <title>Boohee Web</title>
</head>

<body>
  <div id="root"></div>
</body>

</html>
